import { useDispatch, useSelector } from "react-redux";
import Apis from "./content/apis/Apis";
import Filter from "./content/components/Filter/Filter";
import Header from "./content/components/Header/Header";
import Rides from "./content/components/Rides/Rides";

function App() {

  const dispatch = useDispatch();

  const { ridesState,userState } = useSelector( state => state.rideStore )

  useEffect(
    () => {
      try{
        Apis(dispatch,userState)
      }catch(err){
        console.log(err)
      }
    }
  ,[])

  return (
    <div className="App">
      <Header />
      <Filter />
      <Rides />
    </div>
  );
}

export default App;
